import 'dart:convert';

import 'package:flutter/material.dart';
import 'package:gocaptcha/slide_captcha.dart';
import 'package:gocaptcha/slide_captcha_model.dart';

// 滑动验证页面 Slide the verification page
class SlidePage extends StatefulWidget {
  const SlidePage({super.key});

  @override
  State<SlidePage> createState() => _SlidePageState();
}

class _SlidePageState extends State<SlidePage> {
  Future<SlideCaptchaModel> getCaptcha() async {
    //模拟gocaptcha服务端返回数据 #Simulate the return data of the gocaptcha server
    var data = {
      "captchaId": "slide-default",
      "captchaKey": "1970677391743258624",
      "masterImageBase64":
      "data:image/jpeg;base64,",
      "thumbImageBase64":
      "data:image/png;base64,",
      "masterWidth": 300,
      "masterHeight": 200,
      "thumbWidth": 67,
      "thumbHeight": 67,
      "thumbSize": 0,
      "displayX": 26,
      "displayY": 17,
    };
    return SlideCaptchaModel.fromJson(data);
  }
  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(title: const Text('滑动验证')),
      body: Center(
        child: Column(
          children: [
            ElevatedButton(
              onPressed: () {

                showDialog(
                  context: context,
                  builder: (_) => SlideCaptcha(
                    getCaptcha: getCaptcha,
                    onEnd: (position) {
                      ///TODO 获取到位置后验证 #Verify after obtaining the location
                    },
                  ),
                );
              },
              child: Text("getSlideCaptcha"),
            ),
          ],
        ),
      ),
    );
  }
}
